(window.webpackJsonp=window.webpackJsonp||[]).push([[890],{1246:function(n,h,g){"use strict";g.r(h);var t=g(44),i=Object(t.a)({},(function(){var n=this,h=n.$createElement,g=n._self._c||h;return g("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[g("h1",{attrs:{id:"chuong-1776-hai-đai-hoang-gia-đen"}},[g("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1776-hai-đai-hoang-gia-đen"}},[n._v("#")]),n._v(" Chương 1776: Hai đại Hoàng giả đến")]),n._v(" "),g("hr"),n._v(" "),g("p",[n._v("Chương 1776: Hai đại Hoàng giả đến"),g("br"),g("br"),n._v("“Chạy đi đâu...”"),g("br"),g("br"),n._v("Nhan Thanh Cổ Thánh lần nữa gào thét, phương thiên họa kích lần nữa hóa thành lưu quang."),g("br"),g("br"),n._v("Trương Hoằng Thiên cũng hướng về phía trước, cả người biến thành một thanh trường kiếm sắc bén, phá không mau chóng đuổi."),g("br"),g("br"),n._v("Nhân kiếm hợp nhất!"),g("br"),g("br"),n._v("Gặp đây hai đại cao thủ công kích, phong cấm không gian, cưỡng ép chạy trốn, làm không cẩn thận sẽ ngã vào thời không loạn lưu, không rõ sống chết, Thần Dung Hoàng không để ý tới chạy trốn, quay người lại, trường đao trong tay lần nữa bổ ngang mà xuống."),g("br"),g("br"),n._v("Song phương lực lượng, ở trên trời đối đầu, ba đại cao thủ lần nữa phun ra máu tươi, bay ngược mà ra."),g("br"),g("br"),n._v("Luân phiên chiến đấu, đều là dầu hết đèn tắt, có thể kiên trì đến bây giờ, tất cả dựa vào một cỗ ý niệm chống đỡ."),g("br"),g("br"),n._v("“Hôm nay thù, tương lai nhất định phải trả...”"),g("br"),g("br"),n._v("Cố nén thương thế bên trong cơ thể, Thần Dung Hoàng đứng dậy, dường như cảm ứng được cái gì, lại không để ý tới chém giết hai người, cắn răng một cái, trường đao trong tay hư không một điểm, nhất đạo lối đi tối thui xuất hiện, thân thể lay động, thẳng tắp nhảy ra ngoài."),g("br"),g("br"),n._v("Nếu như mặc cho hắn nhảy vào thông đạo, chẳng khác nào cá bơi biển cả, hổ vào thâm sơn, còn muốn bắt lại, đã không thể nào."),g("br"),g("br"),n._v("Nhan Thanh Cổ Thánh hàm răng cắn chặt, trong tay phương thiên họa kích run rẩy, muốn phong tỏa không gian, chỉ thấy hướng nơi xa kéo dài thông đạo, đột nhiên ngừng lại, bất cứ lúc nào cũng sẽ chạy trốn Thần Dung Hoàng, như là bị rút được trên bờ ngư, vô luận như thế nào nhảy lên, đều không thể rời đi."),g("br"),g("br"),n._v("“Dung Hoàng, đừng có gấp đi, lão bằng hữu tới, làm sao cũng muốn trò chuyện một hồi...”"),g("br"),g("br"),n._v("Ngay sau đó một cái thanh âm nhàn nhạt vang lên, ngay sau đó, sâu trong hư không, hai cái thân ảnh cao lớn đi ra."),g("br"),g("br"),n._v("Hai người này, cùng Thần Dung Hoàng quần áo tương tự, trên trán đều mang vương miện, trên người sát lục chi khí, nồng đậm như mực, nhìn lên một cái, cũng làm người ta như rơi xuống địa ngục."),g("br"),g("br"),n._v("“Chẳng lẽ là... Cái khác hai vị Hoàng giả?”"),g("br"),g("br"),n._v("Trương Huyền đồng tử co rút lại."),g("br"),g("br"),n._v("Nhìn quần áo, cùng trên người huyết mạch lực lượng, có thể đoán ra, hai người này, chính là muốn chém giết Thần Dung Hoàng, Thần Linh Hoàng cùng Thần Tinh Hoàng!"),g("br"),g("br"),n._v("Không nghĩ tới hai vị này Hoàng giả, cũng rời đi Dị Linh tộc, tự thân đến nơi này!"),g("br"),g("br"),n._v("Hơn nữa nhìn bộ dáng của bọn hắn, đã sớm ẩn giấu ở xung quanh, Linh Thần không có rời đi, một mực không dám xuất hiện!"),g("br"),g("br"),n._v("“Động thủ với ta, Linh Thần đã biết ngọn nguồn, chắc chắn sẽ không bỏ qua các ngươi...”"),g("br"),g("br"),n._v("Nhìn thấy hai người, Thần Dung Hoàng cũng lại kìm nén không được, râu tóc nâng lên, trường đao trong tay bỗng nhiên đánh xuống."),g("br"),g("br"),n._v("Rầm!"),g("br"),g("br"),n._v("Đao mang xé rách không gian, uy lực tuy cực lớn, nhưng bị thương nặng phía dưới, tại hai đại Hoàng giả phía trước, liền không đáng chú ý."),g("br"),g("br"),n._v("Ngón tay nhẹ nhàng sờ một cái, Thần Linh Hoàng liền đem đao mang ngăn tại bên ngoài."),g("br"),g("br"),n._v("“Dung Hoàng không cần kích động, huynh đệ chúng ta chỉ là tâm sự, có giết hay không, quá tầm thường? Lại nói, Linh Thần coi như biết chúng ta muốn giết ngươi... Giờ phút này nàng quay về Linh Thần điện, cũng là ngoài tầm tay với! Lại nói... Thần là không có tình cảm, ngươi chẳng lẽ thật đơn thuần cho rằng, đường đường Thần Linh, sẽ vì ngươi ra mặt a?”"),g("br"),g("br"),n._v("Khóe miệng nâng lên, Thần Linh Hoàng một mặt thương hại nhìn qua: “Nàng chỉ là mượn ngươi tay, tìm tới Xuân Thu đại điển mà thôi, chẳng lẽ, thật đúng là cho rằng, sẽ coi trọng ngươi?”"),g("br"),g("br"),n._v("“Ngươi...”"),g("br"),g("br"),n._v("Biết hai vị này tại, khẳng định trốn không thoát, Thần Dung Hoàng vẻ mặt bình phục, lần nữa đứng thẳng sống lưng, tựa như một cây giáo, giữa hai lông mày mang theo không thể xâm phạm ác liệt: “Xưa nay ta mang các ngươi không tệ, vì sao muốn phản bội...”"),g("br"),g("br"),n._v("“Vì sao muốn phản bội?”"),g("br"),g("br"),n._v("Thần Linh Hoàng hừ lạnh: “Ngươi quá nghe theo vị này tân nhiệm Linh Thần ra lệnh! Trước kia Linh Thần, chỉ cần chúng ta hiến tế danh sư, liền sẽ ban tặng vô số bảo vật, nàng cho chúng ta cái gì? Hơn nữa, còn không cho chúng ta tấn công! Không tấn công, chẳng lẽ muốn chúng ta hàng ngàn vạn Linh tộc người, một mực tử thủ tại loại này địa phương?”"),g("br"),n._v(" “Linh Thần dặn dò, ngươi cũng dám vi phạm?”"),g("br"),g("br"),n._v("Không nghĩ tới, căn bản nhất nguyên do tại đây, Thần Dung Hoàng cau mày."),g("br"),g("br"),n._v("Còn tưởng rằng là đối với hắn bất mãn, góp gió thành bão, đạt tới không thể điều tiết tình trạng, nằm mơ đều không có nghĩ đến, vậy mà nguyên nhân căn bản nhất, tại Linh Thần."),g("br"),g("br"),n._v("Linh Thần, không cho bọn họ tấn công, là tránh khỏi Linh tộc bị thương tổn, cũng là đối tộc nhân một loại bảo vệ, vì sao đến đối phương trong miệng, ngược lại thành ràng buộc?"),g("br"),g("br"),n._v("“Linh Thần dặn dò, đương nhiên không dám vi phạm, nhưng... Giết ngươi, ta chính là Linh tộc mạnh nhất Hoàng giả... Chỉ cần ta nguyện ý, còn không phải nói cái gì là cái gì? Chẳng lẽ ngươi cho rằng, Linh Thần sẽ lần nữa xuống dò xét? Xuyên qua thế giới, không dễ dàng như vậy, coi như Thần Linh, cũng sẽ nhận không thể chống lại phản phệ, nếu không, cũng sẽ không tại danh sư đại lục, tu dưỡng trọn vẹn hơn nửa năm.”"),g("br"),g("br"),n._v("Thần Linh Hoàng cười lạnh, lông mày giương lên: “Yên tâm đi, ngươi chết rồi, ta sẽ cùng Linh Thần trình báo, ngươi bị Chư Tử bách gia cùng Danh Sư đường đám người liên hợp chém giết, ta chạy tới cứu người thời điểm, đã chậm, trước khi hấp hối, đem đệ nhất Hoàng giả chi vị, truyền thụ cho ta, để cho ta thống lĩnh toàn bộ chủng tộc. Sau đó, ta sẽ lấy sinh mệnh của ngươi, khích lệ tộc nhân, tìm nhân tộc báo thù...”"),g("br"),g("br"),n._v("  “Ngươi...”"),g("br"),g("br"),n._v("Thần Dung Hoàng thân thể vụt qua."),g("br"),g("br"),n._v("Cái tên này mưu kế hay, tất cả đều đang tính toán bên trong!"),g("br"),g("br"),n._v("Vốn còn nghĩ, thật đem tự mình giết, thuộc hạ của mình khẳng định sẽ báo thù, hiện tại xem ra, đem bô ỉa hướng Chư Tử bách gia cùng Danh Sư đường khẽ bóp, không những hắn không có việc gì, còn có thể gây nên nhiều người giận dữ, từ đó thỏa mãn dã tâm của hắn!"),g("br"),g("br"),n._v("“Thần Linh Hoàng, ngươi đừng quên cùng chúng ta ước định...”"),g("br"),g("br"),n._v("Nghe nói như thế, Nhan Thanh Cổ Thánh cũng biến sắc, nhịn không được nói."),g("br"),g("br"),n._v("Vốn cho rằng, giết Thần Dung Hoàng, Dị Linh tộc hội nguyên tức giận đại thương, không nghĩ tới, đối phương chân chính chủ chiến phái, là vị này Thần Linh Hoàng, Dung Hoàng thật muốn chết rồi, nhân tộc cùng đối phương chiến đấu, sợ rằng sẽ càng thêm nhiều lần, lại khó mà khống chế."),g("br"),g("br"),n._v("“Yên tâm, ước định ta sẽ tuân thủ! Bất quá, có phải hay không ba trăm năm, liền không nhất định...”"),g("br"),g("br"),n._v("Thần Linh Hoàng cười lạnh."),g("br"),g("br"),n._v("Nếu như nhân tộc đạt được Xuân Thu đại điển, trở về trốn ba trăm năm không có gì, nhưng đại điện bị Linh Thần mang đi, nhân tộc cái gì đều không có vớt lên không nói, hiện tại Chư Tử bách gia Cổ Thánh cùng Danh Sư đường Cổ Thánh, cũng đều bản thân bị trọng thương..."),g("br"),g("br"),n._v("Đối bọn hắn tới nói, ngược lại là lớn nhất cơ hội!"),g("br"),g("br"),n._v("“Ngươi có ý tứ gì?”"),g("br"),g("br"),n._v("Nhan Thanh Cổ Thánh đồng tử co rụt lại, trong tay phương thiên họa kích nâng lên."),g("br"),g("br"),n._v("Cái khác rất nhiều Cổ Thánh cũng tích tụ cùng một chỗ, sợ cái tên này lại đột nhiên ra tay."),g("br"),g("br"),n._v("Một đầu Dị Linh tộc Hoàng giả, liền giết bọn họ hầu như toàn quân bị diệt, cái tên này lại ra tay, nhất định sẽ lần nữa rơi vào nguy cục."),g("br"),g("br"),n._v("“Không có ý tứ gì, nếu là liên minh, liền không khả năng ra tay với các ngươi, nếu không, ta cũng sẽ nhận thệ ước phản phệ... Yên tâm đi, hai chúng ta tộc đằng sau làm như thế nào, ta xử lý xong hắn, sẽ cùng các ngươi đàm phán...”"),g("br"),g("br"),n._v("Gặp Nhan Thanh Cổ Thánh đám người một mặt cảnh giác, Thần Linh Hoàng biết, đối phương cho dù bị thương nặng, thủ đoạn toàn bộ ra lời nói, cũng có cơ hội, kéo hắn đệm lưng. Huống chi hiện tại chủ yếu nhất không phải cùng nhân tộc trở mặt, mà là củng cố quyền lợi của mình."),g("br"),g("br"),n._v("Chỉ có chân chính đem tộc nhân toàn bộ nắm giữ trong lòng bàn tay, mới có tư cách suy nghĩ, tiếp tục chiến đấu còn là tuân thủ ước định."),g("br"),g("br"),n._v("Rõ ràng những này, mỉm cười, lần nữa nhìn về phía trước mắt Dung Hoàng."),g("br"),g("br"),n._v("“Dung Hoàng, tạm biệt!”"),g("br"),g("br"),n._v("Tiếng hừ lạnh bên trong, bàn tay giơ lên, bỗng nhiên đập xuống."),g("br"),g("br"),n._v("Tựa như thiên địa móc ngược, cường đại đến cực điểm lực lượng, chấn vỡ không gian, bỗng nhiên hướng Thần Dung Hoàng nghiền ép mà tới."),g("br"),g("br"),n._v("Người đăng: ThấtDạ"),g("br"),g("br"),g("br"),g("br")]),n._v(" "),g("hr"),n._v(" "),g("p",[g("a",{attrs:{href:"./chap-1787"}},[n._v("Chương trước")]),n._v("  |  "),g("a",{attrs:{href:"./chap-1789"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);